import ExpenseItem from "./ExpenseItem.js";
import "./Expenses.css";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}
      />
      <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props[2].date}
      />
      <ExpenseItem
        title={props[3].title}
        amount={props[3].amount}
        date={props[3].date}
      />
    </div>
  );
}

export default Expenses;
